set(groot, 'defaultLegendInterpreter', 'latex');
histogram(extractRight, 'Normalization','probability', 'BinWidth',1);
max = 0.45;
line([m m],[0 max], 'Color', 'r', 'LineWidth', 1.5);
xlim([-0.5 12.5]);
ylim([0 max]);
set(gca, 'XTick', 0:1:12);
set(gca, 'YTick', 0:0.05:max);
ytix = get(gca, 'YTick')*100;
labels = regexp(sprintf('%d\\%%\n', uint8(ytix')), '\n', 'split')';
labels = labels(1:end-1);
s=get(gca, 'YTickLabel');
set(gca, 'YTickLabel',labels);
legend({'Anteil der Messungen',sprintf('Durchschnitt: %0.5f ms', m)});
xlabel('Zeit in ms');
ylabel('Anteil');
grid on
title('High-End Computer');
matlab2tikz('extrRightHEPC.tex')